window.bookSummaryJSON = "<p>Devon Sanders, a private investigator known for his efficiency and discretion, has no interest in getting involved with the paranormal community. Unfortunately for him, the paranormal community does have an interest in him, or at least in his secret. Devon is exceptional in solving cases using his uncanny intuition. </p> <p>When Devon uncovers a violent murder, he knows it is not a natural crime. In order to solve this case and expose the murderer, he will have to go undercover as a wizard in the paranormal university, Quintessence. He soon discovers that his talent has more to do with supernatural forces than he ever knew. </p> <p>Magic is elemental. </p>"; 
